import React, {Component, Fragment} from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";
import whiteLogo from '../../asset/image/navlogo.svg';
import blueLogo from '../../asset/image/navlogoscroll.svg'
import '../../asset/css/custom.css'
import '../../asset/css/bootstrap.min.css'

class TopNavigation extends Component {

    constructor() {
        super();
        this.state = {
            navBarTitle: "navTitle",
            navBarLogo: [whiteLogo],
            navVarint: "dark",
            navBarBack: "navBackground",
            navBarITem: "navItem"


        }
    }

    onScroll = () => {
        if (window.scrollY > 100) {
            this.setState({
               
                navBarTitle: 'navTitleScroll',
                navBarLogo: [blueLogo],
                navBarBack: 'navBackgroundScroll',
                navBarITem: 'navItemScroll'
            })
        } else if (window.scrollY < 100) {
            this.setState({
                navVariant: 'dark',
                navBarTitle: 'navTitle',
                navBarLogo: [whiteLogo],
                navBarBack: 'navBackground',
                navBarITem: 'navItem'
            })
        }
    }

    componentDidMount() {
        window.addEventListener('scroll', this.onScroll)
    }

    render() {
        return (
            <Fragment>
                <Navbar variant={this.state.navVariat} className={this.state.navBarBack} fixed={"top"} collapseOnSelect
                        expand="lg">
                    <Container>
                        <Navbar.Brand className={this.state.navBarTitle}><img src={this.state.navBarLogo}/> Real Estate
                            Company</Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="me-auto">

                            </Nav>
                            <Nav>
                                <Nav.Link className={this.state.navBarITem} href="#deets">HOME</Nav.Link>
                                <Nav.Link className={this.state.navBarITem} href="#deets">SERVICES</Nav.Link>
                                <Nav.Link className={this.state.navBarITem} href="#deets">COURSES</Nav.Link>
                                <Nav.Link className={this.state.navBarITem} href="#deets">PORTFOLIO</Nav.Link>
                                <Nav.Link className={this.state.navBarITem} href="#deets">CONTACT</Nav.Link>
                                <Nav.Link className={this.state.navBarITem} href="#deets">ABOUT ME</Nav.Link>

                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>

            </Fragment>
        )
            ;
    }
}

export default TopNavigation;
